// TODO maybe not needed for 2nd gen grow box
export const ANIMATION_SLOW_MS = 500;
export const ANIMATION_MEDIUM_MS = 300;
export const ANIMATION_FAST_MS = 100;
export function animationDurationToMs(duration) {
  return {
    fast: ANIMATION_FAST_MS,
    medium: ANIMATION_MEDIUM_MS,
    slow: ANIMATION_SLOW_MS,
  }[duration];
}
